import {View, Text, Image, StyleSheet} from 'react-native'

const frogItem = props =>{
    var img = require(props.image);
    return(
        <View style={styles.frogs}>
            <Image source={img} />        
            <Text>{props.name}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    frogs:{
        width: "100%"
    }
})

export default frogItem;
